import React from "react";
import { Link, useNavigate } from "react-router-dom";
import "./navbar.css";  // Add some CSS for styling

const Navbar = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Clear authentication state and redirect to login
    navigate("/");
  };

  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark px-4 shadow-sm">
      <div className="container-fluid">
        <Link className="navbar-brand" to="/production">MILL</Link>
        <div className="collapse navbar-collapse">
          <ul className="navbar-nav me-auto">
            <li className="nav-item">
            <NavLink to="/production" className={({ isActive }) => (isActive ? "nav-link active" : "nav-link")}>
  Production
</NavLink>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/electrical">Electrical</Link>
            </li>
          </ul>

          {/* Logout button */}
          <button 
            className="btn btn-outline-danger" 
            onClick={handleLogout}
          >
            Logout
          </button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
